import React from "react";
import './Equipos.css'

export default class Equipo extends React.Component {
    constructor(props) {
        super(props);
        this.state= {
            escondido: false
        }

        this.toggleEsconder = this.toggleEsconder.bind(this);
    }

toggleEsconder() {
this.setState(prevState => ({
    escondido: !prevState.escondido
}))
}



